import { Chrono } from "react-chrono";

function Formation() {
	const items = [
		{
			title: "May 1940",
			cardTitle: "Dunkirk",
			url: "http://www.history.com",
			cardSubtitle: "Men of the British Expeditionary Force (BEF) wade out to..",
			cardDetailedText: "Men of the British Expeditionary Force (BEF) wade out to..",
			media: {
				name: "dunkirk beach",
				source: {
					url: "..//image.jpg",
				},
				type: "IMAGE",
			},
		},
		{
			title: "May 1940",
			cardTitle: "Dunkirk",
			url: "http://www.history.com",
			cardSubtitle: "Men of the British Expeditionary Force (BEF) wade out to..",
			cardDetailedText: "Men of the British Expeditionary Force (BEF) wade out to..",
		},
	];

	return (
		<div>
			<Chrono items={items} mode='VERTICAL_ALTERNATING' borderLessCards hideControls useReadMore={false} />
		</div>
	);
}

export default Formation;
